[StandardAccuracy(1,1)] |cffffffffde probabilidad de golpe|r

Arroja nueces al enemigo, lo que inflige [FormatDamage(SimpleDamage(1,1)+SimpleDamage(1,2)+SimpleDamage(1,3))] p. de daño de [School()].

Las nueces siguen cayendo sobre la mascota activa del enemigo e infligen [StandardDamage(1,1, 166)] p. de daño de [School()] por ronda durante [duration(1,4)] |4ronda:rondas;

Las habilidades tienen una probabilidad de activar la trampa, que inflige [StandardDamage(getProcIndex(PROC_ON_AURA_REMOVED
),1)] p. de daño [School()] y aturde a la mascota durante [duration(getProcIndex(PROC_ON_AURA_REMOVED
),2)] |4ronda:rondas;.

|cffffffffProbabilidad de golpe:|r [StandardAccuracy(2,1)]

[StandardAccuracy(1,1)] |cffffffffde probabilidad de golpe|r

Arroja huesos al enemigo y le inflige [FormatDamage(SimpleDamage(1,1)+SimpleDamage(1,2)+SimpleDamage(1,3))] p. de daño de [School()].

Los huesos siguen cayendo sobre la mascota activa del enemigo y le infligen [StandardDamage(1,1, 166)] p. de daño de [School()] por ronda durante [duration(1,4)] |4ronda:rondas;

Las habilidades tienen una probabilidad de activar la trampa, que inflige [StandardDamage(getProcIndex(PROC_ON_AURA_REMOVED
),1)] p. de daño [School()] y aturde a la mascota durante [duration(getProcIndex(PROC_ON_AURA_REMOVED
),2)] |4ronda:rondas;.
